import React from 'react';
import './App.css';


function Items(){
  return (<div className="items">  <Item type="About"/>   <Item type="Proyect"/>  <Item type="Contact"/> </div> );}
const Item = (props) => <a className="item" href="hello"> {props.type}</a>;

function Brand(){
  return <div className="brand">Logo corporativo</div> 
}




function App() {
  return (
    <div className="App" >
       <nav className="navbar">  <Brand/>   <Items/>  </nav> 
    </div>
  );
}

export default App;
